import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterOutlet } from '@angular/router';
import { ButtonwithiconComponent } from './shared/components/molecules/buttonwithicon/buttonwithicon.component';
import { ButtonComponent } from './shared/components/atoms/button/button.component';
import { LabelComponent } from './shared/components/atoms/label/label.component';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [CommonModule, RouterOutlet,ButtonwithiconComponent,ButtonComponent,LabelComponent ],
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'UNIDADEMPRENDIMIENTO';
}
<h1>Componentes en Angular con Atomic Design</h1>

<app-label text="Nombre"></app-label>
<app-button label="Enviar" classList="btn-primary"></app-button>
<app-buttonwithicon label="Guardar" icon="save" classList="btn-success"></app-buttonwithicon>
